import React from "react";

const RequestTable = ({ requests }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Page URL</th>
          <th>Description</th>
        </tr>
      </thead>
      <tbody>
        {requests.map((request) => (
          <tr key={request.id}>
            <td>{request.name}</td>
            <td>
              <a
                href={request.pageUrl}
                target="_blank"
                rel="noopener noreferrer"
              >
                {request.pageUrl}
              </a>
            </td>
            <td>{request.description}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default RequestTable;
